import Document, { Head, Main, NextScript } from 'next/document'
import { extractCritical } from 'emotion-server'
import { NextSeo } from 'next-seo';

export default class MyDocument extends Document {
  static getInitialProps({ renderPage }) {
    const page = renderPage()
    const styles = extractCritical(page.html)
    return { ...page, ...styles }
  }

  render() {
    return (
      <html lang="en">
        <Head>
          <meta name="description" content="React package form and React hook for validation forms." />
          <title>React Data Forms</title>
          <link rel="icon" href="form-complete.svg" />
          <style
            data-emotion-css={this.props.ids.join(' ')}
            dangerouslySetInnerHTML={{ __html: this.props.css }}
          />
        </Head>
        <NextSeo
          title="React Data Forms"
          description="React library form and React hook for validation forms."
          canonical="https://www.react-data-forms.org"
        />
        <body>
          <Main />
          <NextScript />
        </body>
      </html>
    )
  }
}
